import './App.css';
import './App.scss';
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom' 
import logo0 from './images/pands.png';
import Header from './components/Header/Header';

function App() {

  let Main = (
    <h2>MAINs</h2>
  )

  let About = (
    <h2>About</h2>
  )

  let header = (
    <div className="Banner">
        <img className="Logo" src={logo0}></img>
        <div className="Navbar">
          <ul>
              <li>
                  <Link to="/">Strona główna</Link>
              </li>
              <li>
                  <Link to="/about">Firma</Link>
              </li>
              <li>
                  <Link to="/offer">Oferta</Link>
              </li>
              <li>
                  <Link to="/service">Usługi</Link>
              </li>
              <li>
                  <Link to="/catalog">Katalog</Link>
              </li>
              <li>
                  <Link to="/orders">Zamówienia</Link>
              </li>
              <li>
                  <Link to="/contact">Kontakt</Link>
              </li>
          </ul>
        </div>
        <div className="Test">
            <p>Zaloguj</p>
        </div>
    </div>
  );

  return (
    <div className="App">
      <Header/>
    </div>
  );
}

export default App;
